import itertools
import sys

sys.setrecursionlimit(15000)

def ans1(quality, wage, k):
    arr = []
    for i in xrange(len(quality)):
        arr.append([quality[i]/float(wage[i]), quality[i], wage[i]])
    arr.sort()
    
    gmin = 0x7fffffff
    it = itertools.combinations(arr, k)
    for line in it:
        ksum = 0
        ksum = line[0][2]
        wval = line[0][2]
        qval = line[0][1]
        for i in xrange(1, len(line)):
            ksum += wval * (line[i][1] / float(qval))
        if ksum < gmin:
            gmin = ksum
    return gmin


